import { useSelector } from 'react-redux'
import { useNavigate } from 'react-router'
import { Switch, Route, Link } from 'react-router-dom';
import {Navbar, Nav, Container, Button} from 'react-bootstrap'


const Toolbar = () => {
const quantity= useSelector(state => state.chart.value.quantity)
const totalprice = useSelector(state => state.chart.value.totalPrice)
console.log(`quantity: ${quantity}`)
const [openCart, setOpenCart] = useState(false)
const nav = useNavigate()

function openthiscart(){
nav("/cart")
setOpenCart(true)
}    

function goback(){
nav("/") 
setOpenCart(false)
}

  return (

       <Navbar sticky="top"  bg="light"  expand="md" >
            <Container>
        <Navbar.Brand href="#home">Some Logo</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className=" d-flex w-100 justify-content-end gap-5">
            <Nav.Link as={Link} to="/">Home</Nav.Link>
            <Nav.Link as={Link} to="/shop">Shop</Nav.Link>
            <Nav.Link as={Link} to="/faq">FAQs</Nav.Link>
            <Nav.Link as={Link} to="/profile">My profile</Nav.Link>

            <Button as={Link} to="/cart" >My cart {quantity}</Button>

          </Nav>
        </Navbar.Collapse>
      </Container>
      </Navbar>

  )
}

export default Toolbar
